import io
import base64
import numpy as np
import torch
import torch.nn as nn
from scipy.special import softmax

def ohe(x, num_values):
  return np.stack([x == i for i in range(num_values)], axis=-1)

def allbut1p(x, active):
  return np.array([np.concatenate(
    [x[i, :p, :], x[i, p+1:, :]], axis=0) for i, p in enumerate(active)])

class ZDataset:
  def __init__(self, sample, config, mode='train'):
    self.mode = mode
    include_additional_features = config.get(
      'include_additional_features', False)
    include_time_since_sliding = config.get(
      'include_time_since_sliding', False)
    nn_teammates_2_level = config.get('nn_teammates_2_level', False)
    nn_include_tired_factors = config.get('nn_include_tired_factors', False)
    nn_add_main_opponent = config.get('nn_add_main_opponent', False)
    nn_include_past_positions = config.get('nn_include_past_positions', False)

    processed_keys = ['player', 'opponents', 'teammates', 'game',
                      'value_head_inputs']
    if nn_teammates_2_level:
      processed_keys += ['pairs']
    if nn_add_main_opponent:
      processed_keys += ['main_opponent']
    should_process = False
    for k in processed_keys:
      if not k in sample:
        should_process = True
        break
      
    if not should_process:
      self.data = {k: v for k, v in sample.items() if k in processed_keys}
    else:
      # num_steps = sample['active'].size
      # if sample['my_offside_flags'].max() > 0:
      #   print(sample['step'][0][0], np.where(sample['my_offside_flags'] > 0)[1])
      # sample['my_offside_flags'] = np.zeros((num_steps, 11))
      # sample['time_since_shot_action'] = np.random.uniform(size=num_steps)
      # sample['time_since_pass_action'] = np.random.uniform(size=num_steps)
  
      
      p_location = np.array([sample['left_team'][i, p,: ] for i, p in enumerate(
        sample['active'])])
      p_direction = np.array([sample['left_team_direction'][
        i, p, :] for i ,p in enumerate(sample['active'])])
      sticky_actions = sample['sticky_actions']
      # import pdb; pdb.set_trace()
      # p_tired = np.array([sample['left_team_tired_factor'][
      #   i, p] for i,p in enumerate(sample['active'])]).reshape(-1, 1)
      # p_role = np.array([sample['left_team_roles'][
      #   i,p] for i, p in enumerate(sample['active'])]).reshape(-1,1)
  
      right_rel_location = sample['right_team']-np.expand_dims(p_location, 1)
      right_rel_direction = sample['right_team_direction']-np.expand_dims(
        p_direction, 1)
      
      left_rel_location = sample['left_team']-np.expand_dims(p_location, 1)
      left_rel_direction = sample['left_team_direction']-np.expand_dims(
        p_direction, 1)
      left_tired = np.expand_dims(sample['left_team_tired_factor'], -1) # 1
      left_roles = ohe(sample['left_team_roles'], 10) # 10
      left_actives = np.expand_dims(sample['left_team_active'], -1)
      
      right_team_tired_factor = np.expand_dims(
        sample['right_team_tired_factor'], -1)
      right_team_roles = ohe(sample['right_team_roles'], 10)
      
      team_left_rel_location = allbut1p(left_rel_location, sample['active']) # 2
      team_left_rel_direction = allbut1p(left_rel_direction, sample['active']) # 2
      team_left_tired = allbut1p(left_tired, sample['active']) # 1
      team_left_roles = allbut1p(left_roles, sample['active']) # 10
      
      if nn_teammates_2_level:
        left_X = np.concatenate([team_left_rel_location, team_left_rel_direction], axis=-1)
        right_X = np.concatenate([right_rel_location, right_rel_direction], axis=-1)

      if nn_add_main_opponent:
        right_rel_ball_location = sample['right_team']-np.expand_dims(sample['ball'][:,:2], 1)
        right_ball_dist = (right_rel_ball_location**2).sum(-1)
        right_closest_id = right_ball_dist.argmin(-1)
        if config.get('nn_main_opp_relative', False):
          op_location = np.array([sample['right_team'][i,p,:] for i,p in enumerate(right_closest_id)])-p_location
          op_direction = np.array([sample['right_team_direction'][i,p,:] for i,p in enumerate(right_closest_id)])-p_direction
        else:
          op_location = np.array([sample['right_team'][i,p,:] for i,p in enumerate(right_closest_id)])
          op_direction = np.array([sample['right_team_direction'][i,p,:] for i,p in enumerate(right_closest_id)])
        op_tired = np.array([sample['right_team_tired_factor'][i,p] for i,p in enumerate(right_closest_id)]).reshape(-1,1)
        op_role = np.array([sample['right_team_roles'][i,p] for i,p in enumerate(right_closest_id)]).reshape(-1,1)

