def activation_from_str(activation):
  return nn.Identity() if activation is None else (
    nn.Sigmoid() if activation == "sigmoid" else nn.Tanh())
  
class ZModelTorso(nn.Module):
  def __init__(self, config):
    super(ZModelTorso, self).__init__()
    self.config = config
    self.name = "ZModelTorso"
    n_units = config['n_units']
    include_additional_features = config.get(
      'include_additional_features', False)
    include_time_since_sliding = config.get(
      'include_time_since_sliding', False)
    self.nn_teammates_2_level = config.get('nn_teammates_2_level', False)
    self.nn_include_tired_factors = config.get('nn_include_tired_factors', False)
    self.nn_add_main_opponent = config.get('nn_add_main_opponent', False)
    self.nn_include_past_positions = config.get(
      'nn_include_past_positions', False)
    include_ball_abs = config.get('nn_add_ball_abs', False)

    if config.get('nn_extra_layers', False):
      self.player = nn.Sequential(
          nn.Linear(14+13*int(include_additional_features)+1*int(
            include_time_since_sliding)+4*int(
              self.nn_include_past_positions), n_units),
          nn.LeakyReLU(),
          nn.Linear(n_units, n_units),
          nn.LeakyReLU(),
          nn.Linear(n_units, n_units),
          )
      if self.nn_teammates_2_level:
        self.teammates_1 = nn.Sequential(
            nn.Conv1d(14+2*int(include_additional_features)+int(
              self.nn_include_tired_factors)+4*int(
                self.nn_include_past_positions), n_units, kernel_size=1),
            nn.LeakyReLU(),
            nn.Conv1d(n_units, n_units, kernel_size=1),
            nn.LeakyReLU(),
            )
        self.teammates_2 = nn.Sequential(
            nn.Conv1d(n_units*2, n_units, kernel_size=1),
            nn.LeakyReLU(),
            nn.Conv1d(n_units, n_units, kernel_size=1),
            nn.LeakyReLU(),
            nn.AvgPool1d(kernel_size=10),
            )
        self.pairs = nn.Sequential(
            nn.Conv2d(4, n_units, kernel_size=1),
            nn.LeakyReLU(),
            nn.Conv2d(n_units, n_units, kernel_size=1),
            nn.LeakyReLU(),
            nn.AvgPool2d(kernel_size=(11,1)),
            )
      else:
        self.teammates = nn.Sequential(
            nn.Conv1d(14+2*int(include_additional_features)+int(
              self.nn_include_tired_factors)+4*int(
                self.nn_include_past_positions), n_units, kernel_size=1),
            nn.LeakyReLU(),
            nn.Conv1d(n_units, n_units, kernel_size=1),
            nn.LeakyReLU(),
            nn.AvgPool1d(kernel_size=10),
            )

      self.opponents = nn.Sequential(
          nn.Conv1d(14+1*int(include_additional_features)+int(
            self.nn_include_tired_factors)+4*int(
              self.nn_include_past_positions), n_units, kernel_size=1),
          nn.LeakyReLU(),
          nn.Conv1d(n_units, n_units, kernel_size=1),
          nn.LeakyReLU(),
          nn.Conv1d(n_units, n_units, kernel_size=1),
          nn.LeakyReLU(),
          nn.AvgPool1d(kernel_size=11),
          )
      
      if self.nn_add_main_opponent:
        self.main_opponent = nn.Sequential(
            nn.Linear(14+int(self.nn_include_tired_factors)+6*int(
              self.nn_include_past_positions), n_units),
            nn.LeakyReLU(),
            nn.Linear(n_units, n_units),
            nn.LeakyReLU(),
            nn.Linear(n_units, n_units),
            )
      
      self.game = nn.Sequential(
          nn.Linear(17+6*int(self.nn_include_past_positions)+4*int(include_ball_abs), n_units),
          #nn.ReLU(),
          nn.LeakyReLU(),
          nn.Linear(n_units, n_units),
          nn.LeakyReLU(),
          nn.Linear(n_units, n_units),
          )
      
      self.last = nn.Sequential(
          nn.Linear(n_units*(4+int(self.nn_add_main_opponent)), 2*n_units),
          nn.LeakyReLU(),
          nn.Linear(2*n_units, n_units),
          nn.LeakyReLU(),
          nn.Linear(n_units, n_units),
          nn.LeakyReLU(),
          )            
    else:
      self.player = nn.Sequential(
          nn.Linear(14+13*int(include_additional_features)+1*int(
            include_time_since_sliding)+4*int(
              self.nn_include_past_positions), n_units),
          nn.LeakyReLU(),
          nn.Linear(n_units, n_units),
          )
      
      if self.nn_teammates_2_level:
        self.teammates_1 = nn.Sequential(
            nn.Conv1d(14+2*int(include_additional_features)+int(
              self.nn_include_tired_factors)+4*int(
                self.nn_include_past_positions), n_units, kernel_size=1),
            nn.LeakyReLU(),
            )
        self.teammates_2 = nn.Sequential(
            nn.Conv1d(n_units*2, n_units, kernel_size=1),
            nn.LeakyReLU(),
            nn.AvgPool1d(kernel_size=10),
            )
        self.pairs = nn.Sequential(
            nn.Conv2d(4, n_units, kernel_size=1),
            nn.LeakyReLU(),
            nn.AvgPool2d(kernel_size=(11,1)),
            )
      else:
        self.teammates = nn.Sequential(
            nn.Conv1d(14+2*int(include_additional_features)+int(
              self.nn_include_tired_factors)+4*int(
                self.nn_include_past_positions), n_units, kernel_size=1),
            #nn.ReLU(),
            nn.LeakyReLU(),
            nn.AvgPool1d(kernel_size=10),
            )

      self.opponents = nn.Sequential(
          nn.Conv1d(14+1*int(include_additional_features)+int(
            self.nn_include_tired_factors)+4*int(
              self.nn_include_past_positions), n_units, kernel_size=1),
          #nn.ReLU(),
          nn.LeakyReLU(),
          nn.Conv1d(n_units, n_units, kernel_size=1),
          nn.LeakyReLU(),
          nn.AvgPool1d(kernel_size=11),
          )
      
      if self.nn_add_main_opponent:
        self.main_opponent = nn.Sequential(
            nn.Linear(14+int(self.nn_include_tired_factors)+6*int(
              self.nn_include_past_positions), n_units),
            nn.LeakyReLU(),
            nn.Linear(n_units, n_units),
            )
      
      self.game = nn.Sequential(
          nn.Linear(17+6*int(self.nn_include_past_positions)+4*int(include_ball_abs), n_units),
          #nn.ReLU(),
          nn.LeakyReLU(),
          nn.Linear(n_units, n_units),
          )
      
      self.last = nn.Sequential(
          #nn.Linear(n_units*4, n_out)
          nn.Linear(n_units*(4+int(self.nn_add_main_opponent)), n_units),
          #nn.Linear(n_units, n_units),
          #nn.ReLU(),
          nn.LeakyReLU(),
          nn.Linear(n_units, n_units),
          nn.LeakyReLU(),
          )
    
  def forward(self, d):
    x_player = self.player(d['player'])
    if self.nn_teammates_2_level:
      x_teammates = self.teammates_1(d['teammates'].transpose(-1,-2))
      x_pairs = self.pairs(d['pairs'].transpose(1,3)).squeeze(-2)
      x_teammates = torch.cat([x_teammates, x_pairs], dim=1)
      x_teammates = self.teammates_2(x_teammates).squeeze(-1)    
    else:
      x_teammates = self.teammates(d['teammates'].transpose(-1,-2)).squeeze(-1)
    x_opponents = self.opponents(d['opponents'].transpose(-1,-2)).squeeze(-1)
    x_game = self.game(d['game'])

    if self.nn_add_main_opponent:
      x_main_opponent = self.main_opponent(d['main_opponent'])
      x = torch.cat([x_player, x_main_opponent, x_teammates, x_opponents, x_game], dim=1)
    else:
      x = torch.cat([x_player, x_teammates, x_opponents, x_game], dim=1)
    x = self.last(x)
    
    return x

class ZModel(nn.Module):
  def __init__(self, config):
    super(ZModel, self).__init__()
    self.config = config
    self.name = "ZModel"
    self.stop_grad_torso = False
    n_out = config['num_actions']
    n_units = config['n_units']
    last_policy_activation = config['policy_output_activation']
    critic_output_activation = config['critic_output_activation']
    separate_key_actions_head = config.get('separate_key_actions_head', False)
    num_agent_embedding_ids = config.get('num_agent_embedding_ids', 0)
    self.add_agent_id_embedding = num_agent_embedding_ids > 0
    self.num_networks = 1 + int(config['separate_critic_net'])
    self.num_outputs = 1 + int(config['actor_critic']) + int(
      separate_key_actions_head)
    
    # import pdb; pdb.set_trace()
    self.first_torso = ZModelTorso(config)
    if self.num_networks == 2:
      self.second_torso = ZModelTorso(config)
    
    last_policy_activation = activation_from_str(last_policy_activation)
    self.policy_head = nn.Sequential(
      # nn.Linear(n_units, n_units),
      # nn.LeakyReLU(),
      nn.Linear(n_units*(1+int(self.add_agent_id_embedding)), n_out),
      last_policy_activation,
      )
    critic_output_activation = activation_from_str(critic_output_activation)
    self.critic_head = nn.Sequential(
      nn.Linear(n_units+6+(int(self.add_agent_id_embedding)*n_units), n_units),
      nn.LeakyReLU(),
      nn.Linear(n_units, 1),
      critic_output_activation,
      )
    if separate_key_actions_head:
      self.key_action_head = nn.Sequential(
        # nn.Linear(n_units, n_units),
        # nn.LeakyReLU(),
        nn.Linear(n_units, 1),
        nn.Sigmoid(),
        )
    else:
      self.key_action_head = None
      
    if self.add_agent_id_embedding:
      self.agent_id_embedding = nn.Sequential(
        nn.Linear(num_agent_embedding_ids, n_units),
        nn.LeakyReLU(),
        nn.Linear(n_units, n_units),
        nn.LeakyReLU(),
        )
    
  def forward(self, d):
    outputs = []
    first_torso_outputs = self.first_torso(d)
    if self.stop_grad_torso:
      first_torso_outputs = first_torso_outputs.detach()
    if self.add_agent_id_embedding:
      first_torso_outputs = torch.cat([
        first_torso_outputs, self.agent_id_embedding(d['agent_id'])], dim=1)
    for head_id, head in enumerate(
      [self.policy_head, self.critic_head, self.key_action_head][
        :self.num_outputs]):
      x = first_torso_outputs if (head_id == 0 or self.num_networks == 1) else(
        self.second_torso(d))
      
      if head_id == 1:
        x = torch.cat([x, d['value_head_inputs']], dim=1)
      outputs.append(head(x))
      
    return tuple(outputs)


def convert_obs(obs):
    res = {}
    for k in obs['players_raw'][0].keys():
        res[k] = np.expand_dims(np.array(obs['players_raw'][0][k]), 0)
    res['opponent_active'] = res['active']
    res['steps_until_reset'] = np.expand_dims(
        np.zeros_like(res['active']), -1)
    res['relative_reward_step'] = np.expand_dims(
        np.zeros_like(res['active']), -1)
    return res


