def add_stateful_observations(
    obs, history, reset_stateful_active_change, max_shot_memory=10,
    max_pass_memory=10, max_sliding_memory=10):
  obs['step'] = 3000 - obs['steps_left']
  if history.get('last_shot_step', None) is not None:
    obs['time_since_shot_action'] = max(
      np.array(0),
      (max_shot_memory - (obs['step'][0]-history['last_shot_step']-1))/(
        max_shot_memory))
  else:
    obs['time_since_shot_action'] = np.array(0)
  
  if history.get('last_pass_step', None) is not None:
    obs['time_since_pass_action'] = max(
      np.array(0),
      (max_pass_memory - (obs['step'][0]-history['last_pass_step']-1))/(
        max_pass_memory))
  else:
    obs['time_since_pass_action'] = np.array(0)
    
  if history.get('last_sliding_step', None) is not None:
    obs['time_since_sliding_action'] = max(
      np.array(0),
      (max_sliding_memory - (obs['step'][0]-history['last_sliding_step']-1))/(
        max_sliding_memory))
  else:
    obs['time_since_sliding_action'] = np.array(0)
    
  if history.get('my_last_possession_data', None) is not None and obs[
      'ball_owned_team'] == -1:
    offside_data = history.get('my_last_possession_data')
    my_offside_players = (np.arange(11) != offside_data[0]) & (
        offside_data[2] > offside_data[1]) & (
          offside_data[2] > offside_data[3])
    obs['my_offside_flags'] = my_offside_players.astype(np.float)
  else:
    obs['my_offside_flags'] = np.zeros((11))
    
  if history.get('prev_active', None) is not None:
    if reset_stateful_active_change and obs['active'] != history[
        'prev_active']:
      obs['time_since_shot_action'] = np.array(0)
      obs['time_since_pass_action'] = np.array(0)
      obs['time_since_sliding_action'] = np.array(0)
    
  obs['time_since_shot_action'] = np.expand_dims(obs['time_since_shot_action'], 0)
  obs['time_since_pass_action'] = np.expand_dims(obs['time_since_pass_action'], 0)
  obs['time_since_sliding_action'] = np.expand_dims(obs['time_since_sliding_action'], 0)
  obs['my_offside_flags'] = np.expand_dims(obs['my_offside_flags'], 0)
  return obs
  
def update_stateful_features(history, action, observation):
  np_obs = observation['numpy_observation']
  if action == 12:
    history['last_shot_step'] = np_obs['step'][0]
  if action in [9, 10, 11]:
    history['last_pass_step'] = np_obs['step'][0]
  if action == 16:
    history['last_sliding_step'] = np_obs['step'][0]
    
  if np_obs['ball_owned_team'] == 1 or np.abs(
      np_obs['ball'][0, :2]).sum() == 0 or (np_obs['game_mode'][0] == 5):
    # Reset offsides at kickoff and throw ins or when the opponent controls
    # the ball.
    history['my_last_possession_data'] = None
  elif np_obs['ball_owned_team'][0] == 0:
    offside_limit = np.sort(
      np_obs['right_team'][0, np_obs['right_team_active'][0] > 0, 0])[-2]
    history['my_last_possession_data'] = (
      np_obs['ball_owned_player'], np_obs['ball'][0, 0],
      np_obs['left_team'][0, :, 0], offside_limit)
  
  history['prev_active'] = np_obs['active']

HISTORY = {}
def agent(obs, env_config, **kwargs):
    global HISTORY
    HISTORY = kwargs.get("history", HISTORY)
    np_obs = convert_obs(obs)
    np_obs = add_stateful_observations(
      np_obs, HISTORY, config['reset_stateful_active_change'])
    ds = ZDataset(np_obs, config, mode='test')
    loader = torch.utils.data.DataLoader(ds, batch_size=1, num_workers=0, shuffle=False, pin_memory=False)
    for bi, d in enumerate(loader):
        for k in d.keys():
            if k not in ['action', 'action_mask']:
                d[k] = d[k].to(device).float()
        preds = model(d)[0].detach().cpu().numpy()

    logits = np.copy(preds)
    probs = softmax(logits, -1).flatten()
    ac = [int(np.random.choice(np.arange(probs.size), p=probs/probs.sum()))]
    
    update_stateful_features(HISTORY, ac[0], {'numpy_observation': np_obs})
    
    if kwargs.get("return_model", False):
      return model, ZDataset, config
    if kwargs.get("return_logits", False):
      return ac, logits, HISTORY
    else:
      return ac
  